addCoords :: [(Int,Int,Int,Int,Int)] -> [(Int,Int)]
addCoords = concatMap getCoords

getCoords :: (Int,Int,Int,Int,Int) -> [(Int,Int)]
getCoords (_,mLeft,mTop,w,h) = [(x,y) | x <- [mLeft..mLeft+w-1], y <- [mTop..mTop+h-1]]

overlappingCoords :: [(Int,Int)]
overlappingCoords = map head (filter (\x -> length x /= 1) $ group $ sort $ addCoords inputData)

findNoOverlap :: [(Int,Int,Int,Int,Int)] -> (Int,Int,Int,Int,Int)
findNoOverlap (x:xs) | hasNoOverlap x = x
                     | otherwise = findNoOverlap xs

getFirst :: (Int,Int,Int,Int,Int) -> Int
getFirst (x,_,_,_,_) = x

hasNoOverlap :: (Int,Int,Int,Int,Int) -> Bool
hasNoOverlap x = null $ getCoords x `intersect` overlappingCoords

resultP1, resultP2 :: Int
resultP1 = length overlappingCoords
resultP2 = getFirst $ findNoOverlap inputData